// This problem may be worth some comments, especially because it took a day
// to me to find all of these out, and it looks so damn easy after that.
//
// First, this damn RGB operation (let's say x) is not associative, because
//    R x (G x B) =/= (R x G) x B
// and it is really sad from the perspective of the algebra, because it
// would be good to have something easy to work with, something like a
// group or a ring.
//
// Fortunately, the Cayley table of (x) looks almost like C3. If
// R = 0, G = 1, B = 2, and the operation of C3 is *, then
//     (a x b) = swapBG(a * b)
// and
//     ((a x b) x (c x d)) = swapBG(swapBG(a * b) * swapBG(c * d))
// and it naturally implies the idea, that maybe
//     ((a x b) x (c x d)) =?  a * b * c * d
// so if we just build the right triangle with the right amount of levels,
// then maybe the good old C3 group will turn this crazy triangle problem
// into the very normal binomial formula.
//
// At this point one may feel it won't really help, because calculating
// all the binomial coefficients typically requires quadratic time. But all
// we need are just the mod 3 values. And a quick look at the Pascal
// triangle reveals there are some rows where almost all tags are divisible
// by 3. See the 3rd, the 27th, the 81th ... etc. lines. So in that case
// calculating the tip of the triangle with the binomial formula is very
// very trivial.
//
// And that's the idea behind the linear algorithm.
//
// (To me it seems the worst case is when the string lenght n=3^x-1.
//  Then the string length in the loop during the run is
//  3^x-1,2*3^(x-1)-1,3^(x-1)-1,2*3^(x-2)-1,... the sum of these is
//  proportional to the work, and
//     3^x-1+2*3^(x-1)-1+3^(x-1)-1+2*3^(x-2)-1+...
//      ~ 3^x+3^x+3^(x-1)+3^(x-2)+... ~ 3^x+3^(x+1)/2 < 3*3^x = 3*n)

function rule(a, b) {
  if (a == b) {
    return a;
  }
  if (a != "R" && b != "R") {
    return "R";
  }
  if (a != "G" && b != "G") {
    return "G";
  }
  if (a != "B" && b != "B") {
    return "B";
  }
  return "";
}

function reduceSimple(row) {
  var retval = "";
  for (var i = 0; i < row.length - 1; ++i) {
    retval += rule(row[i], row[i + 1]);
  }
  return retval;
}

function reduce(row) {
  var windowsize = 1;
  while (windowsize * 3 + 1 < row.length) {
    windowsize = windowsize * 3;
  }
  if (windowsize == 1) {
    var retval = reduceSimple(row);
    return retval;
  }
  var retval = "";
  for (var x = 0; x < row.length - windowsize; ++x) {
    retval += rule(row[x], row[x + windowsize]);
  }
  return retval;
}

function triangle(row) {
  while (row.length > 1) {
    row = reduce(row);
  }
  return row;
}

